using Retypeit.Scripts.Bindings.Interpreter;namespace Retypeit.Scripts.Bindings.Ast{    public class EqualNode : IBooleanResultNode    {        public EqualNode(IAstNode value1, IAstNode value2)        {            Value1 = value1;            Value2 = value2;        }        public IAstNode Value1 { get; set; }        public IAstNode Value2 { get; set; }        public object Accept(IVisitor visitor)        {            return visitor.Visit(this);        }    }}